export default class Module {
    runtime: any;
    _children: any;
    _rawModule: any;
    state: any;
    constructor(rawModule: any, runtime: any);
    get namespaced(): boolean;
    addChild(key: any, module: any): void;
    removeChild(key: any): void;
    getChild(key: any): any;
    hasChild(key: any): boolean;
    update(rawModule: any): void;
    forEachChild(fn: Function): void;
    forEachGetter(fn: Function): void;
    forEachAction(fn: Function): void;
    forEachMutation(fn: Function): void;
}
